import React from 'react';

const Sidebar = (props) => {
    return (
        <div className="sidebar-container" id={props.myId}>
            <ul>
                {props.data.map(item =>
                    <li>{item.section}</li>
                )}
            </ul>
        </div>
    );
};

export default Sidebar;
